import React from 'react';
import "./Gallery.css";
const galleryitem={
    name:"gallery",
    icon:"https://photo-zmp3.zadn.vn/banner/1/b/7/6/1b76f9e27f5341899d45f758e3d27a4b.jpg"
}
function GalleryItem() {
    return (
      <>
          <img alt={galleryitem.name} className={galleryitem.name} src={galleryitem.icon}/>
      </>
    );
  }
  

export default GalleryItem;
